import React, { Component } from 'react';
import Axios from 'axios';
import Header from '../components/Header';
import Router from '../components/Router';
import Produto from '../components/Produto';
import Footer from '../components/Footer';

class Home extends Component {

  constructor(props) {
    super(props);

    this.state = {
      produto: [],
      counter: 0
    };
  }

  handleChildClick(name){
    console.log(name);
    this.setState({
      counter: this.state.counter + 1
    })
  }

  componentDidMount(){
    Axios.get('http://localhost:4000/produto')
    .then(response => {
      const {data} = response;
      data.map((item, k) => {
        console.log(item);
        this.setState({
          produto: item
        })
      })
    })
    .catch(error => {
      this.setState({
        produto: {
          "name": "Rasteria Tira Dedo",
          "cod": "RT 0568 | 03.07.0653",
          "description": "Rasteira em atanado soft com tira dedo e fechamento de fivela, possui sola sempre na cor do cabedal",
          "active": true,
